import React from "react";
import {Link} from "react-router-dom"
import { IconButton } from "@chakra-ui/react"

import {  ImBlog} from "react-icons/im";

const Navbar = () => {
    return (  
        <nav className="navbar">
            <h1>
            <IconButton
            as="a"
            href="/"
            aria-label="Github"
            icon={<ImBlog />}
            borderRadius="100%"
            size='lg'
            colorScheme='teal'
            variant='outline'
          />
            </h1>
            <div className="links">
            <Link to="/">Home</Link>
            <Link to="/create" >New Post</Link>
            </div>
        </nav>
    );
}

export default Navbar;
